import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('domcontentloaded');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and extract product data
    await page.waitForSelector('.product-card, [class*="card"]', { timeout: 5000 });
    const products = await page.$$eval('.product-card, [class*="card"]', cards => 
      cards.map(card => ({
        title: card.querySelector('h3, [class*="title"]')?.textContent?.trim() || 'No title',
        price: card.querySelector('[class*="price"], .product-price')?.textContent?.trim() || 'No price',
        rating: card.querySelector('[class*="rating"], .stars')?.textContent?.trim() || 'No rating'
      }))
    );

    // Extract navigation links
    const navLinks = await page.$$eval('a, [href]', links => 
      links.map(link => ({
        text: link.textContent?.trim() || 'No text',
        href: link.getAttribute('href') || 'No href'
      }))
    );

    // Extract category information
    const categories = await page.$$eval('[class*="category"], [class*="nav"]', elements => 
      elements.map(el => ({
        text: el.textContent?.trim() || 'No text',
        class: el.className || 'No class'
      }))
    );

    // Extract input fields and buttons
    const formElements = await page.$$eval('input, button, select', elements => 
      elements.map(el => ({
        type: el.tagName.toLowerCase(),
        id: el.id || 'No id',
        class: el.className || 'No class',
        placeholder: el.getAttribute('placeholder') || 'No placeholder'
      }))
    );

    // Take screenshot after data extraction
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_data_extracted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_data_extracted.png'));

    return {
      success: true,
      action: "Extracted product data, navigation links, categories, and form elements from Amazon simulation",
      extractedData: {
        products,
        navLinks,
        categories,
        formElements
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to extract data from Amazon simulation",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
